import React, { Component } from 'react'
import {Link, Redirect} from "react-router-dom"
export default class Admin extends Component {
  constructor(props){
    super(props)
    const token=localStorage.getItem("token")
    let loggedInn=true
    if (token=== null){
      loggedInn=false
    }
    this.state={
      loggedInn

    }
  }
  componentDidMount(){
    console.log(token)
  }


  render() {
    if(this.state.loggedInn=== false){
    return  <Redirect to="/"/>
    }
    return (
      <div>admin page</div>
    )
  }
}
